import React from 'react';
import ReactDOM from 'react-dom';
import App from './components/App'; 
import "./style.css";
ReactDOM.render(
  <React.StrictMode>
    <img className="icon" src={require("img/header.png")} />
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
